PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE user (
	id INTEGER NOT NULL, 
	telegram_id INTEGER NOT NULL, language TEXT, 
	PRIMARY KEY (id)
);
CREATE TABLE project (
	id INTEGER NOT NULL, 
	coin_name VARCHAR(100), category VARCHAR(100), 
	PRIMARY KEY (id)
);
CREATE TABLE calculation (
	id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	date DATETIME, agent_answer TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES user (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE basic_metrics (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	entry_price FLOAT, 
	sphere VARCHAR(50), 
	market_price FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE investing_metrics (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	fundraise FLOAT, 
	fund_level TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE social_metrics (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	twitter INTEGER, 
	twitterscore INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE tokenomics (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	circ_supply FLOAT, 
	total_supply FLOAT, 
	capitalization FLOAT, 
	fdv FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE top_and_bottom (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	lower_threshold FLOAT, 
	upper_threshold FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE market_metrics (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	fail_high FLOAT, 
	growth_low FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE manipulative_metrics (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	fdv_fundraise FLOAT, 
	top_100_wallet FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE network_metrics (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	tvl FLOAT, 
	tvl_fdv FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE funds_profit (
	id INTEGER NOT NULL, 
	project_id INTEGER NOT NULL, 
	distribution TEXT, 
	average_price FLOAT, 
	x_value FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
CREATE TABLE IF NOT EXISTS "agentanswer" (
	id INTEGER NOT NULL, 
	answer TEXT, 
	language TEXT, 
	updated_at DATETIME, 
	project_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT fk_agentanswer_project FOREIGN KEY(project_id) REFERENCES project (id)
);
COMMIT;
